import React from "react";
import "./posts.css";

const Posts = ({
  postTitle,
  postBody
}) => {
  return (
    <div className="postDiv">
      <a className="postLink" href="#">
        <div className="postTitle">
            <div>{postTitle}</div>
        </div>
        <div className="postBody">
            <div>{postBody}</div>
        </div>
      </a>
    </div>
  );
};

export default Posts;
